import Card from '../Card/Card';
import style from './Cards.module.css';

export default function Cards({ characters , onClose }) {

   return (
     <div className={style.card}>
       {characters.map(({ id, name, species, gender, image }) => {
         return (
           <Card 
            id={id}
             name={name}
             species={species}
             gender={gender}
             image={image}
             onClose={onClose}
           />
         );
       })}
     </div>
   );
 }
